window.bookSummaryJSON = "<p><b>A time traveler’s work is never done.</b></p> <p>Likable antiques dealer Joseph Bridgeman is back in the present and dreaming of a quiet life. But when a mysterious and enigmatic time traveler arrives in his shop, Joe learns that his first trip was just the beginning and this time, the rules of the game have changed.</p> <p>Blackmailed into accepting a new mission, Joe is flung back to 1960s London where he comes face-to-face with a ruthless gangster and witnesses the brutal murder of an innocent woman. Joe knows better than most that death can be reversed and the final chapter is sometimes where the story actually begins. Emotionally involved, he has no choice but to act, and quickly. With the help of Vinny, his vinyl-loving sidekick, Joe once again sets out to change the course of history. Sounds simple enough...but when it comes to time travel, nothing is ever as it seems. Who is the old time traveler working for? And who decides what can and can’t be changed?&nbsp;</p> <p>In a thrilling twist, Joe discovers that the victim is critically important to the future, and what starts out as a straightforward mission soon becomes a race to unravel a mystery - one that threatens the very timeline he fought so hard to protect. Joe must dig deeper than ever, master his newfound skills, and save the woman before the past catches up with him for good.</p> <p>Turns out time doesn’t heal after all. It just adds salt.</p>"; 
